package com.zhzx.dao.bean.prod;import com.zhzx.dao.bean.BaseBean;public class ProdInfo extends BaseBean {		/**	*商品编号	*/	private String id;		/**	*商品名称	*/	private String name;		/**	*商品展示名称	*/	private String displayName;		/**	*商品数量	*/	private Integer stock;		/**	*商品状态（下架：0，正常销售：1）	*/	private String status;		/**	*商品价格	*/	private String price;		/**	*商品URL地址	*/	private String url;		/**	*商品描述	*/	private String discribe;		/**	*	*/	private String createTime;		/**	*	*/	private String updateTime;			public String getId() {	    return this.id;	}	public void setId(String id) {	    this.id=id;	}	public String getName() {	    return this.name;	}	public void setName(String name) {	    this.name=name;	}	public String getDisplayName() {	    return this.displayName;	}	public void setDisplayName(String displayName) {	    this.displayName=displayName;	}	public Integer getStock() {	    return this.stock;	}	public void setStock(Integer stock) {	    this.stock=stock;	}	public String getStatus() {	    return this.status;	}	public void setStatus(String status) {	    this.status=status;	}	public String getPrice() {	    return this.price;	}	public void setPrice(String price) {	    this.price=price;	}	public String getUrl() {	    return this.url;	}	public void setUrl(String url) {	    this.url=url;	}	public String getDiscribe() {	    return this.discribe;	}	public void setDiscribe(String discribe) {	    this.discribe=discribe;	}	public String getCreateTime() {	    return this.createTime;	}	public void setCreateTime(String createTime) {	    this.createTime=createTime;	}	public String getUpdateTime() {	    return this.updateTime;	}	public void setUpdateTime(String updateTime) {	    this.updateTime=updateTime;	}}